import React from "react";
import "./Projects.css";
import project1 from "../assets/project1.jpg"; // Make sure image exists
import project2 from "../assets/project2.jpg"; // Add more as needed

const Projects = () => {
  return (
    <div className="projects-container">
      <h2 className="section-title">Projects</h2>

      <div className="project-item">
        <img src={project1} alt="Water Leakage Detection" className="project-image" />
        <div className="project-details">
          <h3>Remote Finder Utilizing RF and Clap Rocognizing Technology</h3>
          <p>
            Developed an IoT-based system that detects and stops water leakage automatically. Overcame underwater leakage challenges and ensured precise real-time monitoring.
          </p>
        </div>
      </div>

      <div className="project-item">
        <img src={project2} alt="Student Registration System" className="project-image" />
        <div className="project-details">
          <h3></h3>
          <p>
            Built with React, Node.js, and MongoDB. Allows students to register with name, roll number, and gender, and enables search functionality to filter students by name.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Projects;
